import './MostPopular.css';
import popular_01 from '../../assests/images/popular-01.jpg';
import popular_02 from '../../assests/images/popular-02.jpg';
import popular_03 from '../../assests/images/popular-03.jpg';
import popular_04 from '../../assests/images/popular-04.jpg';
import popular_05 from '../../assests/images/popular-05.jpg';
import popular_06 from '../../assests/images/popular-06.jpg';
import popular_07 from '../../assests/images/popular-07.jpg';
import popular_08 from '../../assests/images/popular-04.jpg';
import Card from '../../components/Card/Card'
const MostPopular= () =>{
 return(
   <>
    <div  className='section-wrapper'>
      <div className='section-header'>
      <h4>Most Popular</h4>

      </div>
      <div className='most-popular-items'>
   
         
           <Card image={popular_01} title="Fortnite" category="Sandbox" rate="3.8" download="2.3M" />
           <Card image={popular_02} title="PubG" category="Stream" rate="4.8" download="1.1M"/>
           <Card image={popular_03} title="Dota2" category="Legendary" rate="2.7" download="5.3M"/>
           <Card image={popular_04} title="CS-GO" category="Battle" rate="3.9" download="6.4M"/>
           <Card image={popular_05} title="Fortnite" category="Sandbox" rate="3.8" download="2.3M" />
           <Card image={popular_06} title="PubG" category="Stream" rate="4.8" download="1.1M"/>
           <Card image={popular_07} title="Dota2" category="Legendary" rate="2.7" download="5.3M"/>
           <Card image={popular_08} title="CS-GO" category="Battle" rate="3.9" download="6.4M"/>
           
              </div>

              


             



         
      
    </div>
   </>

 )
};
export default MostPopular;
